import React, { useState } from 'react';
import GoogleSheetsData from './components/GoogleSheetsData';
import './App.css';

function App() {
  const [sheetUrl, setSheetUrl] = useState('');
  const [showGoogleSheets, setShowGoogleSheets] = useState(false);

  return (
    <>
      <div className="background-overlay"></div>
      <div className="App olympic-theme">
        <div className="header-strip">
          <img
            src="/Olympic_rings_without_rims.png"
            alt="Olympics Logo"
            className="olympics-logo"
          />
          <h1 className="site-title">Olympic Team Dashboard</h1>
          <p className="site-tagline">Track your teams in Olympic style</p>
        </div>
        <section className="olympic-gallery-section">
          <h2 className="section-title">Teams</h2>
          <div className="olympic-gallery">
            {[0, 1].map(row =>
              <div className="gallery-row" key={row}>
                {[1, 2, 3, 4].map(col => {
                  const num = row * 4 + col;
                  return (
                    <div className="gallery-item" key={num}>
                      <img
                        src={`/img${num}.png`}
                        alt={`Team ${num}`}
                        className="gallery-img"
                      />
                      <div className="gallery-label">Team {num}</div>
                    </div>
                  );
                })}
              </div>
            )}
          </div>
        </section>
        <section className="sheets-integration-section">
          <div className="sheets-card">
            <h2 className="section-title">Connect Your Google Sheet</h2>
            <div className="url-input-container">
              <input
                type="text"
                placeholder="Paste your Google Sheets URL here..."
                value={sheetUrl}
                onChange={(e) => setSheetUrl(e.target.value)}
                className="url-input"
              />
              <button
                onClick={() => setShowGoogleSheets(true)}
                className="connect-btn"
                disabled={!sheetUrl.trim()}
              >
                Connect Sheet
              </button>
            </div>
            {showGoogleSheets && (
              <GoogleSheetsData sheetUrl={sheetUrl} />
            )}
          </div>
        </section>
      </div>
    </>
  );
}

export default App;
